DROP TABLE IF EXISTS `known_ll`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `known_ll` (
  `atom_name` varchar(2) DEFAULT NULL COMMENT 'Active atom name',
  `host` varchar(15) DEFAULT NULL COMMENT 'Host',
  `min_wl` double DEFAULT NULL COMMENT 'Minimum laser wavelength',
  `max_wl` double DEFAULT NULL COMMENT 'Maximum laser wavelength',
  `ull_name` varchar(6) DEFAULT NULL COMMENT 'Transition upper laser level name',
  `lll_name` varchar(6) DEFAULT NULL COMMENT 'Transition lower laser level name',
  `term_engy` double DEFAULT NULL COMMENT 'Terminal level energy (cm)',
  `ka_conc` double DEFAULT NULL COMMENT 'Laser ion concentration (%)',
  `kf_life` double DEFAULT NULL COMMENT 'Flourescence lifetime (msec)',
  `kf_width` double DEFAULT NULL COMMENT 'Fluorescence linewidth (cm)',
  `op_mode` varchar(2) DEFAULT '' COMMENT 'Mode of operation',
  `kll_temp` double DEFAULT NULL COMMENT 'Temperature (Kelvin)',
  `kll_size` varchar(8) DEFAULT NULL COMMENT 'Crystal size (mm)',
  `kll_pump` varchar(6) DEFAULT NULL COMMENT 'Optical pump',
  `kll_thres` double DEFAULT NULL COMMENT 'Threshold',
  `footnote` int(11) DEFAULT NULL,
  `uid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Generated Unique Identifier',
  `kll_date` date DEFAULT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=1850 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

